import React from "react";
import LogIn from "../../components/UserLogIn";
import HeaArrow from "../../components/HeaArr";

const Login = () => {
  return (
    <div>
      <p>Si aún no te registras</p>
      <a href>
        <span>Hazlo aquí</span>
      </a>
      <HeaArrow />
      <LogIn />
    </div>
  );
};

export default Login;
